import React from "react";
//import * as List from "./temp";

function App() {
  return (
    <>
      <div className="cards">
        <div className="card">
          <img src="" alt="image" className="cardName" />
          <div className="card_info">
            <span className="card_category">A NETFLIX Original</span>
            <h3 className="card_title">Dark</h3>
            <a href="" target=" "></a>
            <button>Watch Now</button>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
